import React, { Component } from "react";
import { GridList, Grid, Container, Button } from "@material-ui/core";

class Cart extends Component {
  render() {
    return (
      <Container>
        <h2>Cart</h2>

        <GridList
          cellHeight={200}
          style={{ marginRight: 100, marginLeft: 100 }}
          cols={1}
        >
          {["white", "yellow", "blue"].map(color => (
            <Grid
              container
              direction="row"
              style={{
                background: color,
                alignContent: "flex-start",
                alignItems: "center",
                justifyContent: "space-between"
              }}
            >
              <Grid container direction="row">
                <img
                  src="https://salt.tikicdn.com/cache/175x175/ts/product/9c/ad/e4/1efb61539a6adcf2da14bd70b21ddf58.jpg"
                  alt="Cart"
                />
                <Grid style={{ background: "pink", width: 300 }}>
                  <h5>Cà phê Sôcôla</h5>
                  <h5>Information</h5>
                  <Button style={{ color: "red" }}>Delete</Button>
                </Grid>
              </Grid>
            </Grid>
          ))}
        </GridList>
      </Container>
    );
  }
}

export default Cart;

